import React from 'react';

const About = () => {
  return (
    <div>
      <h2>About Page</h2>
      <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed eget turpis id elit blandit
        consequat. Sed sagittis, massa quis posuere lacinia, purus neque consequat ipsum, in
        faucibus mauris mauris eu sapien.
      </p>
      <p>
        Aenean bibendum ipsum in sem venenatis, non dictum ligula efficitur. Etiam convallis quis
        justo et dictum. Suspendisse at sapien eget nisl blandit posuere. Nunc iaculis velit vitae
        nisi aliquet, in tincidunt elit varius.
      </p>
    </div>
  );
};

export default About;
